$(document).ready(function () {
  $(".qomticket")
    .first()
    .on("ready.flickity", function () {
      console.log("yoyo")
      $(".qomticket").css("display", "block")
      $(".qomticket").css("visibility", "visible")
      setTimeout(() => {
        $(".qomticket").removeClass("loading")
      }, 300)
    })
})
